import React from 'react'


    const ResponseList = ({wishes}) => {
        console.log(wishes)
        return(
                <div>
                    <h5>Wish List</h5>
                    <ul>
                        {wishes ? wishes.map(wish => {
                            return(
                                <li key={wish.id}>
                                    {wish.text}
                                </li>
                            )
                        }) : null}
                    </ul>
                </div>
        )
    }

export default ResponseList
